url\":\"\/timedtext_video?ref=watch\\u0026v=leFuF-zoVzA\",\"rootVe\":83769}},\"urlEndpoint\":{\"url\":\"\/timedtext_video?ref=watch\\u0026v=leFuF-zoVzA\"}}}]},\"noSubtitlesText\":{\"simpleText\":\"This video doesn't have subtitles or closed captions yet.\"},\"promoSubtitlesText\":{\"simpleText\":\"Help this video reach more people by contributing subtitles or closed captions in a language you speak.\"}}}}},\"videoDetails\":{\"videoId\":\"leFuF-zoVzA\",\"title\":\"How I Made My Own iPhone - in China\",\"lengthSeconds\":\"1429\",\"keywords\":[\"iPhone\",\"Shenzhen\",\"China\",\"Electronics\",\"Phones\",\"Smartphones\",\"iPhone China\",\"Strange Parts\",\"Make iPhone\"],\"channelId\":\"UCO8DQrSp5yEP937qNqTooOw\",\"isOwnerViewing\":false,\"shortDescription\":\"I built a like-new(but really refurbished) iPhone 6S 16GB entirely from parts I bought in the public cell phone parts markets in Huaqiangbei.  And it works!\\n\\nHow much did it cost? Answer here: https:\/\/youtu.be\/-KucQDXnKws\\n\\nI've been fascinated by the cell phone parts markets in Shenzhen, China for a while.  I'd walked through them a bunch of times, but I still didn't understand basic things, like how they were organized or who was buying all these parts and what they were doing with them.\\n\\nSo when someone mentioned they wondered if you could build a working smartphone from parts in the markets, I jumped at the chance to really dive in and understand how everything works.  Well, I sat on it for nine months, and then I dove in.\\n\\nMore details at: https:\/\/strangeparts.com\/how-i-made-my-own-iphone-in-china\/\\n\\nMy Gear:\\nI shot it on this camera: http:\/\/amzn.to\/2B0Snke\\nAnd also with this: http:\/\/amzn.to\/2BhdF1e\\nAnd recorded sound on this: http:\/\/amzn.to\/2CFuyPv\\nCollaborative editing software: http:\/\/bit.ly\/frameio-sp\\n\\nFacebook: http:\/\/facebook.com\/strangepartscom\\nTwitter: http:\/\/twitter.com\/strangepartscom\\nInstagram: http:\/\/instagram.com\/strangeparts_com\\nEmail Newsletter: http:\/\/strangeparts.com\/\\n\\nSpecial thanks to everyone that helped:Ian Lesnet (dangerousprototypes.com), Jin Lin (dangerousprototypes.com and flylin.co),  Helen, Frank, David, Wyman from G-Lon Cell Phone Repair School (facebook.com\/wyman.liu.1), Charles Pax (paxinstruments.com), Patrick O'Doherty, Matt Turzo, Richard Littauer, the EFF, Bunnie Huang (bunniestudios.com), Sean Cross (xobs.io), all the rest of my friends in China that have been supportive, and most importantly all the Huaqiangbei market sellers that were so generous with their time and advice!\\n\\n#StrangeParts #PhoneAdventures #China\",\"isCrawlable\":true,\"thumbnail\":{\"thumbnails\":[{\"url\":\"https:\/\/i.ytimg.com\/vi\/leFuF-zoVzA\/hqdefault.jpg?sqp=-oaymwEiCKgBEF5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\\u0026rs=AOn4CLBUL2S8alAAXZTMDCGX6hhPXqsb_A\",\"width\":168,\"height\":94},{\"url\":\"https:\/\/i.ytimg.com\/vi\/leFuF-zoVzA\/hqdefault.jpg?sqp=-oaymwEiCMQBEG5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\\u0026rs=AOn4CLAIDmcc4-U1aP_LXFY3w410T1PDiA\",\"width\":196,\"height\":110},{\"url\":\"https:\/\/i.ytimg.com\/vi\/leFuF-zoVzA\/hqdefault.jpg?sqp=-oaymwEjCPYBEIoBSFryq4qpAxUIARUAAAAAGAElAADIQj0AgKJDeAE=\\u0026rs=AOn4CLDZGrwJPRWTVEVp9vYMGJnKjXTetQ\",\"width\":246,\"height\":138},{\"url\":\"https:\/\/i.ytimg.com\/vi\/leFuF-zoVzA\/hqdefault.jpg?sqp=-oaymwEjCNACELwBSFryq4qpAxUIARUAAAAAGAElAADIQj0AgKJDeAE=\\u0026rs=AOn4CLDnVAOf1gHRvmPbZNBcDtGlmEKR6g\",\"width\":336,\"height\":188},{\"url\":\"https:\/\/i.ytimg.com\/vi\/leFuF-zoVzA\/maxresdefault.jpg\",\"width\":1920,\"height\":1080}]},\"averageRating\":4.8470688,\"allowRatings\":true,\"viewCount\":\"23776689\",\"author\":\"Strange Parts\",\"isPrivate\":false,\"isUnpluggedCorpus\":false,\"isLiveContent\":false},\"annotations\":[{\"playerAnnotationsExpandedRenderer\":{\"featuredChannel\":{\"startTimeMs\":\"5000\",\"endTimeMs\":\"1408000\",\"watermark\":{\"thumbnails\":[{\"url\":\"https:\/\/i.ytimg.com\/an\/O8DQrSp5yEP937qNqTooOw\/featur .com\/embed\/leFuF-zoVzA\",\"flashUrl\":\"http:\/\/www.youtube.com\/v\/leFuF-zoVzA?version=3\\u0026autohide=1\",\"width\":1280,\"height\":720,\"flashSecureUrl\":\"https:\/\/www.youtube.com\/v\/leFuF-zoVzA?version=3\\u0026autohide=1\"},\"title\":{\"simpleText\":\"How I Made My Own iPhone - in China\"},\"description\":{\"simpleText\":\"I built a like-new(but really refurbished) iPhone 6S 16GB entirely from parts I bought in the public cell phone parts markets in Huaqiangbei.  And it works!\\n\\nHow much did it cost? Answer here: https:\/\/youtu.be\/-KucQDXnKws\\n\\nI've been fascinated by the cell phone parts markets in Shenzhen, China for a while.  I'd walked through them a bunch of times, but I still didn't understand basic things, like how they were organized or who was buying all these parts and what they were doing with them.\\n\\nSo when someone mentioned they wondered if you could build a working smartphone from parts in the markets, I jumped at the chance to really dive in and understand how everything works.  Well, I sat on it for nine months, and then I dove in.\\n\\nMore details at: https:\/\/strangeparts.com\/how-i-made-my-own-iphone-in-china\/\\n\\nMy Gear:\\nI shot it on this camera: http:\/\/amzn.to\/2B0Snke\\nAnd also with this: http:\/\/amzn.to\/2BhdF1e\\nAnd recorded sound on this: http:\/\/amzn.to\/2CFuyPv\\nCollaborative editing software: http:\/\/bit.ly\/frameio-sp\\n\\nFacebook: http:\/\/facebook.com\/strangepartscom\\nTwitter: http:\/\/twitter.com\/strangepartscom\\nInstagram: http:\/\/instagram.com\/strangeparts_com\\nEmail Newsletter: http:\/\/strangeparts.com\/\\n\\nSpecial thanks to everyone that helped:Ian Lesnet (dangerousprototypes.com), Jin Lin (dangerousprototypes.com and flylin.co),  Helen, Frank, David, Wyman from G-Lon Cell Phone Repair School (facebook.com\/wyman.liu.1), Charles Pax (paxinstruments.com), Patrick O'Doherty, Matt Turzo, Richard Littauer, the EFF, Bunnie Huang (bunniestudios.com), Sean Cross (xobs.io), all the rest of d":"UCO8DQrSp5yEP937qNqTooOw","isOwnerViewing":false,"shortDescription":"I built a like-new(but really refurbished) iPhone 6S 16GB entirely from parts I bought in the public cell phone parts markets in Huaqiangbei.  And it works!\n\nHow much did it cost? Answer here: https://youtu.be/-KucQDXnKws\n\nI've been fascinated by the cell phone parts markets in Shenzhen, China for a while.  I'd walked through them a bunch of times, but I still didn't understand basic things, like how they were organized or who was buying all these parts and what they were doing with them.\n\nSo when someone mentioned they wondered if you could build a working smartphone from parts in the markets, I jumped at the chance to really dive in and understand how everything works.  Well, I sat on it for nine months, and then I dove in.\n\nMore details at: https://strangeparts.com/how-i-made-my-own-iphone-in-china/\n\nMy Gear:\nI shot it on this camera: http://amzn.to/2B0Snke\nAnd also with this: http://amzn.to/2BhdF1e\nAnd recorded sound on this: http://amzn.to/2CFuyPv\nCollaborative editing software: http://bit.ly/frameio-sp\n\nFacebook: http://facebook.com/strangepartscom\nTwitter: http://twitter.com/strangepartscom\nInstagram: http://instagram.com/strangeparts_com\nEmail Newsletter: http://strangeparts.com/\n\nSpecial thanks to everyone that helped:Ian Lesnet (dangerousprototypes.com), Jin Lin (dangerousprototypes.com and flylin.co),  Helen, Frank, David, Wyman from G-Lon Cell Phone Repair School (facebook.com/wyman.liu.1), Charles Pax (paxinstruments.com), Patrick O'Doherty, Matt Turzo, Richard Littauer, the EFF, Bunnie Huang (bunniestudios.com), Sean Cross (xobs.io), all the rest of my friends in China that have been supportive, and most importantly all the Huaqiangbei market sellers that were so generous with their time and advice!\n\n#StrangeParts #PhoneAdventures #China","isCrawlable":true,"thumbnail":{"thumbnails":[{"url":"https://i.ytimg.com/vi/leFuF-zoVzA/hqdefault.jpg?sqp=-oaymwEiCKgBEF
